import Landing from '../components/Landing.js'
import 'bootstrap/dist/css/bootstrap.min.css'
import Testing from './routes/Testing.js';

function App() {
  return (
    <div className="App">
      <Routes>
      <Route path="/" element={<Landing/>}/>
      <Route path="/testing" element={<Testing/>}/>
      </Routes>

      </div>
  );
}

export default App;
